import React from 'react';
import classNames from 'classnames';

const Logo = ({
  className,
  ...props
}) => {

  const classes = classNames(
    'brand',
    className
  );

  return (
    <div
      {...props}
      className={classes}
    >
      <h3 className="m-0">
        <Link to="/">
            Capless.ai
        </Link>
      </h3>
    </div>
  );
}

export default Logo;
